import './singup.css'
import React , {useState} from 'react'
import {useNavigate} from 'react-router-dom'
import axios from '../../'
import { set } from 'mongoose'



 const SingUp = () => {
     const [username ,setUsername] = useState(null);
     const [password , setPassword] = useState(null);
     const [email, setMail] = useState(null);
     const [fullName , setFullname] = useState(null);
     const [phoneNumber , setPhonenumber] = useState(null)
     const [error, setError] = useState(false);

     const navigate = useNavigate()

     const handlerSingup = () => {
        if(!username || !password || !email || !phoneNumber) {
            setError(true)
        }else {
            setError(false)
        }

         const user = {
            username : username
         }
     }



     return (
        <div>
            <div className='main'>
                <div className='container'>
                    <div className='item'>
                        <h1>Sing Up</h1>
                    </div>

                    <div className='item'>
                        <input type='text' placeholder='UserName' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>

                    <div className='item'>
                        <input type='password' placeholder='Password' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>
                    <div className='item'>
                        <input type='text' placeholder='UserName' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>

                    <div className='item'>
                        <input type='text' placeholder='Full Name' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>

                    <div className='item'>
                        <input type='text' placeholder='Number Phone' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>

                    <div className='item'>
                        <input type='email' placeholder='Email' className='input' onChange={(e)=> setUsername(e.target.value)} />
                    </div>

                    <div className='item'>
                        <button  className='button'  onClick={handlerSingup}>Create Account</button>
                    </div>
                </div>
            </div>
        </div>
     )

 }

 export default SingUp
